import React from 'react';

import title from './Title';

var bgc = {
  color: 'blue',
  backgroundColor: 'blue',
  width: '100px',
  height: '100px'
};

const App = () => {
  return (
    <div className="ui container" style={bgc}>
      {title()}
    </div>
  );
};
export default App;
